import { FaGithub } from 'react-icons/fa'; // Import the Font Awesome icons
import '../styles/styles.css';

const FeedbackLoop: React.FC = () => {
  return (
    <div className="page" id="feedback-loop">
      <h2>Feedback Loop Page</h2>
      <p>This is the Feedback Loop page content.</p>


                  <img src="https://i.imgur.com/jEG1vzh.jpg" alt="First slide"/>



                  <img src="https://i.imgur.com/3cn0kbB.jpg" alt="Second slide"/>

                  <img src="https://i.imgur.com/VtEp5eX.jpg" alt="Third slide"/>

                  <img src="https://i.imgur.com/soZy4vL.png" alt="Fourth slide"/>

    </div>
  );
};

export default FeedbackLoop;
